const handleSearch = async () => {
  setLoading(true);
  setError(null);
  try {
    const response = await fetchOrgaoInfo(cnpj, dataInicial, dataFinal, 1);

    console.log("Resposta da busca:", response); // Adicione este log para verificar a resposta

    if (response.orgao && response.contratos.length > 0) {
      setOrgao(response.orgao);
      setContratos(response.contratos);
    } else {
      setError("Não foi possível encontrar informações para o CNPJ informado.");
    }
  } catch (err) {
    if (err instanceof Error) {
      setError(err.message);
    } else {
      setError("Erro desconhecido.");
    }
  } finally {
    setLoading(false);
  }
};
